import React from 'react';

const HeaderComponent = () => {
  return (
    <div>
      <header>
        <nav className="navbar navbar-dark bg-dark">
          <div className="container-fluid">
            <a className="navbar-brand" href="/">User Management System</a>
          </div>
        </nav>
      </header>
    </div>
  );
}

export default HeaderComponent;
